def longest_subarray(a, k):
    if sum(a) <= k:
        return len(a)
    if sum(a) > k:
        max_length = 0
        current_sum = 0
        for i in range(len(a)):
            current_sum += a[i]
            while current_sum > k:
                current_sum -= a[i - max_length]
                max_length -= 1
            max_length += 1
        return max_length
    if sum(a) == k:
        return len(a)
    if not a:
        return 0
```

